// ... (importy)
import { useAuth } from '../context/AuthContext'; // Importujemy hooka useAuth
import { useNavigate } from 'react-router-dom'; // Do przekierowania po wylogowaniu

const DashboardPage = () => {
  // ... (stany: user, topTracks, topArtists, loading)
  const { logout } = useAuth(); // Pobieramy funkcję logout z kontekstu
  const navigate = useNavigate(); // Hook do nawigacji

  // ... (useEffect do pobierania danych - możesz usunąć z niego blok catch przekierowujący do logowania,
  //      bo ProtectedRoute już o to dba)

  const handleLogout = async () => {
    await logout();
    navigate('/'); // Przekieruj na stronę logowania po wylogowaniu
  };
  
  // ... (reszta logiki i JSX)

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        {user && <h1>Witaj, {user.display_name}!</h1>}
        <button onClick={handleLogout} className="logout-button">Wyloguj</button>
      </header>
      {/* ... reszta JSX ... */}
    </div>
  );
};

export default DashboardPage;
